import React from "react"

function TodoItem(p) {
    return (
        <div>
            <li>
                <input 
                    type="checkbox"
                    checked={p.item.completed}
                    onChange={() => p.handleChange(p.item.id)}
                />
                {p.item}
            </li>
        </div>
    )
}

export default TodoItem
